import React, { Component } from 'react'
import $ from 'jquery';

export class Navigation extends Component {

  state = {
    resumeData : {},
  }
  getResumeData(){
    $.ajax({
      url:'/data.json',
      dataType:'json',
      cache: false,
      success: function(data){
        this.setState({resumeData: data});
      }.bind(this),
      error: function(xhr, status, err){
        console.log(err);
        alert(err);
      }
    });
  }

  componentDidMount(){
    this.getResumeData();
  }

  render() {
    return (
        <nav id="menu" className="navbar navbar-default navbar-fixed-top">
        <div className="container">
          <div className="navbar-header">
            <p>Family de la Salle</p> </div>

            <h1>{this.props.data ? this.props.data.phone : 'loading'}</h1>
          <div className="collapse navbar-collapse" id="bs-example-navbar-collapse-1">
            <ul className="nav navbar-nav navbar-center">
              <li><a href="/tree" >Family Tree</a></li>
              <li><a href="/timeline">Timeline</a></li>
              <li><a href="/gallery" data={this.state.resumeData.Contact}>Records</a></li>
              <li><a href="/contact" data={this.state.resumeData.Contact}>Contact</a></li>
            </ul>
          </div>
        </div>
      </nav>
    )
  }
}

export default Navigation
